    <text class="replace" fill="black" xml:space="preserve" style="white-space: pre; font-size: 18px; font-weight: 400;" font-family="Arial" font-size="18" letter-spacing="0em"><tspan x="16" y="448.24">The Rat is the first of all zodiac animals. </tspan><tspan x="16" y="474.24">According to one myth, the Jade Emperor </tspan><tspan x="16" y="500.24">said the order would be decided by the </tspan><tspan x="16" y="526.24">order in which they arrived to his party. </tspan><tspan x="16" y="552.24">The Rat tricked the Ox into giving him a </tspan><tspan x="16" y="578.24">ride. Then, just as they arrived at the finish </tspan><tspan x="16" y="604.24">line, Rat jumped down and landed ahead </tspan><tspan x="16" y="630.24">of Ox, becoming first.
    </tspan><tspan x="16" y="656.24">
    </tspan><tspan x="16" y="682.24">The Rat is also associated with the Earthly </tspan><tspan x="16" y="708.24">Branch (d zh) Zi () and the </tspan><tspan x="16" y="734.24">midnight hours. In the terms of yin and </tspan><tspan x="16" y="760.24">yang (yn yng), the Rat is yang </tspan><tspan x="16" y="786.24">and represents the beginning of a new </tspan><tspan x="16" y="812.24">day.
    </tspan><tspan x="16" y="838.24">
    </tspan><tspan x="16" y="864.24">In Chinese culture, rats were seen as a </tspan><tspan x="16" y="890.24">sign of wealth and surplus. Because of </tspan><tspan x="16" y="916.24">their reproduction rate, married couples </tspan><tspan x="16" y="942.24">also prayed to them for children.</tspan></text>
